import { format} from 'date-fns';


export default function Post({title,summary,filepath,content,author}) {
  
    return (
        <div className="post">
            <div className="image">
            <img src={'https://upload.wikimedia.org/wikipedia/commons/thumb/5/53/Google_%22G%22_Logo.svg/2008px-Google_%22G%22_Logo.svg.png'} alt="Uploaded Image" > </img>
            <p></p>
            </div>
            <div className="texts">
                <h2>{title}</h2>
                <p className="info">
                    <a className="author"></a>
                    <time>{format(new Date(), 'MMMM d, yyyy')}</time>
                </p>
                <p className="summary">{summary}</p>
            </div>
        </div>
    );

}
